$.tablesorter.addParser({id:"dates",is:function(a){return false},format:function(c){var b=c.match(/^(\d{2})\-(\w{3})\-(\d{4})$/);if(!b){return new Date().getTime()}var e=b[1];var a=b[2];var f=b[3];return new Date(a+" "+e+" "+f).getTime()},type:"numeric"});$.tablesorter.addParser({id:"groksizes",is:function(a){return false},format:function(b){var d=b.match(/^(\d{1,3}(?:[, ]?\d{1,3})*(?:\.\d+)?|\.\d+) ?(\w*)$/);if(d===null||d.length<3){return 0}var a=d[1].replace(/[, ]/g,"");var c=d[2];if(c=="KiB"){return(a*1024)}else{if(c=="MiB"){return(a*1024*1024)}else{if(c=="GiB"){return(a*1024*1024*1024)}else{return(a)}}}},type:"numeric"});